import React from "react";

const Profile = () => {
  return (
    <main id="main-container">
      {/* Hero */}
      <div
        className="bg-image"
        style={{ backgroundImage: "url('assets/media/photos/photo17@2x.jpg')" }}
      >
        <div className="bg-black-25">
          <div className="content content-full">
            <div className="py-5 text-center">
              <a className="img-link" href="be_pages_generic_profile.html">
                <img
                  className="img-avatar img-avatar96 img-avatar-thumb"
                  src="assets/media/avatars/avatar10.jpg"
                  alt=""
                />
              </a>
              <h1 className="font-w700 my-2 text-white">George Taylor</h1>
              <button type="button" className="btn btn-hero-primary">
                <i className="fa fa-fw fa-user-plus mr-1"></i> Add
              </button>
              <button type="button" className="btn btn-hero-dark">
                <i className="fa fa-fw fa-envelope mr-1"></i> Message
              </button>
            </div>
          </div>
        </div>
      </div>
      {/* END Hero */}

      {/* END Page Content */}
    </main>
  );
};

export default Profile;
